import React, { useEffect } from 'react'
import { Tooltip, IconButton, TextField, Dialog, DialogTitle, Zoom } from '@material-ui/core'
import AddIcon from '@material-ui/icons/Add';
import CreateIcon from '@material-ui/icons/Create';
import Carousel from 'react-material-ui-carousel'
import { useParams } from 'react-router';

function getWordlistCode() {
    const wordlistCode = useParams();
    return wordlistCode;
}

export default class WordlistCreator extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            userDetails: {
                username: "",
                email: ""
            },
            wordlistCode: ""
        }
    }

    // Adding user details pre render
    componentWillMount() {
        let uid = sessionStorage.getItem("uid");
        let wordlistCode = getWordlistCode();
        console.log(wordlistCode)
        this.setState({
            wordlistCode: wordlistCode
        })

        fetch('http://sddmajordev:5000/api/userbase/get_user_by_uid', {
            method: 'post',
            headers: {
              'Content-Type':  'application/json',
            }, 
            body: JSON.stringify({"uid": uid})
          })
          .then(response => response.json())
          .then(data => {
              this.setState({userDetails: data})
        })
    }

    render() {
        var items = [
            {
                name: "Random Name #1",
                description: "Probably the most random thing you have ever seen!"
            },
            {
                name: "Random Name #2",
                description: "Hello World!"
            }
        ]

        if (this.state.accountType === "student") {
            // Return Student Dashboard
        } else {
            // Return Teacher Dashboard
            return (
                <div>
                    <h1 style={{textAlign: "center"}}>{this.state.wordlistCode}</h1>
                    <TextField label="Search Wordlist" variant="outlined"></TextField>
                    <Dialog open={this.state.openCreateWordlist}>
                        <DialogTitle>Hey</DialogTitle>
                    </Dialog>
                </div>
            )
        }
    }
}
